import React from "react";

const StudentList = (props) => {
	const students = props.students.map(
		({ firstName, city, company, email, grades, id, lastName, pic, skill }) => {
			console.log(
				firstName,
				city,
				company,
				email,
				grades,
				id,
				lastName,
				pic,
				skill
			);
			return (
                <div>
				<div className="ui divided items">
					<div className="item">
						<div
							style={{ border: "1px solid black" }}
							className="ui circular small image"
						>
							<img src={pic} />
						</div>
					</div>
					<div className="ui divided items">
						<h1 className="ui header">
							{firstName} {lastName}
						</h1>
						<div>
							<div className="item">Email: {email}</div>
							<div className="item">Company: {company}</div>
							<div className="item">Skill: {skill}</div>
							<div className="item">Average: {grades}</div>
						</div>
					</div>
				</div>
                </div>
			);
		}
	);
	return <div>{students}</div>;
};

export default StudentList;
